import WatchingVideo_left_top from './wVideo_left_top/WVideo_left_top'
import WatchingVideo_left_bot from './wVideo_left_bot/WVideo_left_bot'
import React from 'react'

export default function WatchingVideoLeft() {


    return ( <
        div className = "col-xl-8 col-lg-8 col-md-10 col-sm-10 mx-auto d-md-flex videoPlaying" >
        <
        div className = "card border"
        style = {
            { marginTop: '50px' }
        } >
        <
        WatchingVideo_left_top > < /WatchingVideo_left_top> <
        WatchingVideo_left_bot > < /WatchingVideo_left_bot> < /
        div > <
        /div>
    )
}
